  [],\n\t\"revision_timestamp\": \"2015-06-17T01:57:56.404739\",\n\t\"name\": \"bear-salmon-study-1952-browns-river-uyak-bay-kodiak-island-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A relatively small number of unspawned
  salmon are taken by bear. Although the figures are not as exact as those of the
  Sulua Creek study, the number represents similar conclusions. This study brings
  out the fact more clearly that the vegetative feeding habits of the bears has an
  effect upon the number of salmon taken. In all studies, observations have shown
  that the elderberry and other berries ripen during the first part of August and
  this type of vegetative food shows predominately in the droppings of the bear by
  August 15. When considering the dates of the runs of salmon in the stream, there
  is only a period of about 15 days after the pink salmon are in the stream before
  the berries are suitable for food for the bear. Also, during this period the salmon
  are fresh and not as vulnerable to capture. After the fish become more concentrated
  in the stream and are not as fresh, they become more available to the bear, but
  the food habits of the bear has changed at least in part.\",\n\t\"license_title\":
